// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awRowRenderFunction } from 'js/AwRowService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwRowService', () => import('js/AwRowService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awRowRenderFunction",
            "deps": "js/AwRowService",
            "options": {
                "elementRefList": [
                    "row"
                ]
            }
        },
        "onMount": {
            "actionType": "JSFunction",
            "method": "onMount",
            "inputData": {
                "elementRefList": "{{parameters.elementRefList}}",
                "props": "{{props}}",
                "data": "{{data}}"
            },
            "deps": "js/AwRowService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onMount": "onMount"
    },
    "_viewModelId": "AwRow",
    "_uniqueViewModelId": "AwRow",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awRowRenderFunction, {"elementRefList":["row"]}, ctxImportObj );

export default Component;
